class Solution {
    func minOperations(_ nums: [Int], _ target: Int) -> Int {
        var ops = 0
        var currentTarget = target

        // Count frequencies of the powers of 2
        var frequency = [Int: Int]()
        for num in nums {
            frequency[num, default: 0] += 1
        }

        let sortedKeys = frequency.keys.sorted(by: >)

        for key in sortedKeys {
            let value = key
            if currentTarget >= value {
                let needed = min(currentTarget / value, frequency[value]!)
                ops += needed
                currentTarget -= value * needed
                if currentTarget == 0 { break }
            }
        }

        return currentTarget == 0 ? ops : -1
    }
}
